                      - type: text
                        text: >-
                          , Giza, announces that the third phase of mobile
                          numbering plan changes in Egypt, as published in ITU
                          Operational Bulletin 970 of 15.XII.2010 will be
                          launched on 6 October 2011. In that phase, all the
                          mobile operators will accept mobile numbers with
                          eleven (11) digits as well as (10) digits length.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          There will be a voice message to inform the customer
                          of the change and inform him to dial 11 digits next
                          time he dials.
